const theme = {
  name: 'theme',
  global: {
    heading: {
      family: "Roboto, 'Helvetica Neue', Helvetica, Arial, 'lsans-serif'",
      face: `
        @font-face: {
          font-family: 'Roboto';
          src: local('Roboto'), url(fonts/roboto/Roboto.woff) format('woff');
        }
      `,
    },
  },
};

export default theme;
